export default (function(a,b,c,d,e,f){return {data:{KMj4act63t:{data:{id:126,attributes:{imdbId:"tt0086879",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWJlNzUzNGMtYTAwMS00ZjI2LWFmNWQtODcxNWUxODA5YmU1XkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"8.3\u002F10"},{Source:"Rotten Tomatoes",Value:"93%"},{Source:"Metacritic",Value:"88\u002F100"}],item_lang:{data:{id:789,attributes:{title:b,plot:"Antonio Salieri believes that Wolfgang Amadeus Mozart's music is divine and miraculous. He wishes he was himself as good a musician as Mozart so that he can praise the Lord through composing. He began his career as a devout man who believes his success and talent as a composer are God's rewards for his piety. He's also content as the respected, financially well-off, court composer of Austrian Emperor Joseph II. But he's shocked to learn that Mozart is such a vulgar creature, and can't understand why God favored Mozart to be his instrument. Salieri's envy has made him an enemy of God whose greatness was evident in Mozart. He is ready to take revenge against God and Mozart for his own musical mediocrity.",slug:"amadeus"}}},books:{data:[{id:2239,attributes:{title:b,description:"0riginating at the National Theatre of Great Britain, Amadeus was the recipient of both the Evening Standard Drama Award and the Theatre Critics Award. In the United States, the play won the coveted Tony Award and went on to become a critically acclaimed major motion picture winning eight Oscars, including Best Picture. Now, this extraordinary work about the life of Wolfgang Amadeus Mozart is available with a new preface by Peter Shaffer and a new introduction by the director of the 1998 Broadway revival, Sir Peter Hall. Amadeus is a must-have for classical music buffs, theatre lovers, and aficionados of historical fiction.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rber8kEuFlgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2001-08-07",publisher:"Harper Collins",subtitle:e}},{id:2240,attributes:{title:b,description:"Explores the relationship between Austrian court composer, Antonio Salieri, and the divinely gifted young Wolfgang Amadeus Mozart. 2 acts, 31 scenes, 9 men, 1 women, extras, 1 setting.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qsryAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:f,publisher:a,subtitle:a}},{id:2241,attributes:{title:"Peter Shaffer's Amadeus",description:"Captures the world of eighteenth-century Vienna, where court musician Salieri reconstructs his efforts to destroy his archrival, Wolfgang Amadeus Mozart, efforts that build to a chilling conclusion",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_h7uqM5Z_yIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1984-01-01",publisher:"New Amer Library",subtitle:a}},{id:2242,attributes:{title:b,description:"This provocative work weaves a confrontation between mediocrity and genius into a tale of breathtaking dramatic power. In the court of the Austrian Emperor Josef, Antonio Salieri is the established composer. Enter the greatest musical genius of all time: Wolfgang Amadeus Mozart. Salieri has given himself to God so that he might realize his sole ambition to be a great composer. Mozart is a foul-mouthed, graceless oaf who has that which is beyond Salieri's envious grasp: Genius.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W8ZYxgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:f,publisher:"Samuel French",subtitle:"A Play"}},{id:2243,attributes:{title:"A Critical Analysis of Amadeus",description:a,thumbnail:a,authors:["Scott Peter Johnson"],firstBook:d,published:"1986-01-01",publisher:a,subtitle:e}}]}}},meta:{}}},prerenderedAt:1680940912144}}("","Amadeus","Peter Shaffer",null,"A Play by Peter Shaffer","1981-01-01"))